import React from 'react';
import './Card.css';

const Card = (txt1,txt2,txt3) => {
  return (
    <div className="card">
      <div className="card-buttons">
        <button className="card-button">txt1</button>
        <button className="card-button">txt2</button>
        <button className="card-button">txt3</button>
      </div>
    </div>
  );
};

export default Card;
